def get_rgb(name, n_tot, num):
    if name not in allmaps.keys():
        print('Error: Unknown color map name. Must be one of {}'
              .format(list(allmaps.keys())))
        return None
    else:
        cmap = allmaps[name]
        if n_tot not in cmap.keys():
            print(('Error: Only the following total color numbers allowed '
                   + 'for {}: {}').format(name, list(cmap.keys())))
            return None
        elif not num <= n_tot or num <= 0:
            print('Error: Color number must be between 1 and n_tot.')
            return None
        else:
            return cmap[n_tot][num-1]


def get_rgb_255(name, n_tot, num):
    rgbcol = get_rgb(name, n_tot, num)
    if rgbcol is not None:
        rgbcol_255 = [round(i*255) for i in rgbcol]
        return rgbcol_255
    else:
        return None


def get_hex(name, n_tot, num):
    rgbcol_255 = get_rgb_255(name, n_tot, num)
    if rgbcol_255 is not None:
        hexcol_str = '#{:02x}{:02x}{:02x}'.format(*rgbcol_255)
        return hexcol_str
    else:
        return None


# functions to return the darker partner color (for edges of points)
def get_partner_rgb(name, n_tot, num):
    rgbcol = get_rgb(name, n_tot, num)
    if rgbcol is not None:
        hlscol = colorsys.rgb_to_hls(*rgbcol)
        d_hlscol = list(hlscol)
        d_hlscol[1] *= 0.8
        d_rgbcol = colorsys.hls_to_rgb(*d_hlscol)
        return d_rgbcol
    else:
        return None


def get_partner_rgb_255(name, n_tot, num):
    d_rgbcol = get_partner_rgb(name, n_tot, num)
    if d_rgbcol is not None:
        d_rgbcol_255 = [round(i*255) for i in d_rgbcol]
        return d_rgbcol_255
    else:
        return None


def get_partner_hex(name, n_tot, num):
    d_rgbcol_255 = get_partner_rgb_255(name, n_tot, num)
    if d_rgbcol_255 is not None:
        hexcol_str = '#{:02x}{:02x}{:02x}'.format(*d_rgbcol_255)
        return hexcol_str
    else:
        return None


