    n = 6
    # do not use the lightest and darkest colors!
    for cmap in ['Greys', 'Purples', 'Blues', 'Greens', 'Oranges', 'Reds']:
        print('Fill colors {}:'.format(cmap))
        for ii in range(n):
            rgbcol_255_str = ('{:3.0f}, {:3.0f}, {:3.0f}'
                              .format(*get_rgb_255(cmap, n, n - ii)))
            hexcol_str = get_hex(cmap, n, n - ii)
            print('RGB: {} | HEX: {}'.format(rgbcol_255_str, hexcol_str))
    for cmap in ['Greys', 'Purples', 'Blues', 'Greens', 'Oranges', 'Reds']:
        print('Edge colors {}:'.format(cmap))
        for ii in range(n - 2):
            rgbcol_255_str = ('{:3.0f}, {:3.0f}, {:3.0f}'
                              .format(*get_partner_rgb_255(cmap, n, n - ii)))
            hexcol_str = get_partner_hex(cmap, n, n - ii)
            print('RGB: {} | HEX: {}'.format(rgbcol_255_str, hexcol_str))
